	backgroundColor: 'white',
	color: '#000000',
	border: '20px solid white',
	borderRadius: '10px',
	boxShadow: 24,
	p: 4,
};

class SignIn extends React.Component {
	constructor(props) {
		super(props);
		this.handleSubmit = this.handleSubmit.bind(this);
		this.state = {
			modalOpen: false,
		}
		this.handleOpenModal = this.handleOpenModal.bind(this);
		this.handleCloseModal = this.handleCloseModal.bind(this);
	}

	async componentDidMount() {
		await getCurrentUser().then((user) => {
			if (user != null) {
				this.props.navigate("/posts");
			}
		});
	}

	async handleSubmit(event) {
		event.preventDefault();
		const data = new FormData(event.currentTarget);
		await signIn(data.get("email"), data.get("password"));
		await getCurrentUser().then((user) => {
			if (user != null) {
				this.props.navigate("/posts");
			}
		});
	}

	async handleResetPassword(event) {
		event.preventDefault();
		const data = new FormData(event.currentTarget);
		await resetPassword(data.get("email"));
	}

	handleOpenModal() {
		this.setState({
			modalOpen: true,
		});
	}

	handleCloseModal() {
		this.setState({
			modalOpen: false,
		});
	}

	render() {
		return (
			<Container component='main' maxWidth='xs' sx={{ marginBlock: "auto" }}>
				<CssBaseline />
				<Box
					sx={{
						marginTop: 8,
						display: "flex",
						flexDirection: "column",
						alignItems: "center",
					}}>
					<Avatar sx={{ m: 1, bgcolor: "primary.main" }}>
						<LockOutlinedIcon />
					</Avatar>
					<Typography component='h1' variant='h5'>
						Sign in
					</Typography>
					<Box
						component='form'
						noValidate
						onSubmit={this.handleSubmit}
						sx={{ mt: 3 }}>
						<Grid container spacing={2}>
							<Grid item xs={12}>
								<TextField
									required
									fullWidth
									autoFocus
									name='email'
									id='email'
									label='Email Address'
									autoComplete='email'
								/>
							</Grid>
							<Grid item xs={12}>
								<TextField
									required
									fullWidth
									name='password'
									id='password'
									label='Password'
									type='password'
									autoComplete='new-password'
								/>
							</Grid>
						</Grid>
						<Button
							type='submit'
							fullWidth
							variant='contained'
							sx={{ mt: 3, mb: 2 }}>
							Sign In
						</Button>
						<Grid container justifyContent='flex-end'>
							<Grid item>
								<Button component={RouterLink} to='/signup'>
									Don't have an account? Sign up
								</Button>
							</Grid>
							<Grid item>
								<Button onClick={this.handleOpenModal}>
									Forgot password?
								</Button>
							</Grid>
						</Grid>
					</Box>
				</Box>
				<Modal
					open={this.state.modalOpen}
					onClose={this.handleCloseModal}
					sx={{
						zIndex: 2000,
					}}
				>
					<Box style={modalStyle}
						component='form'
						noValidate
						onSubmit={this.handleResetPassword}
					>
						<Stack direction="row">
							<Typography variant="h6" component="h2">
								Reset Password
							</Typography>
							<IconButton
								color="primary"
								component="label"
								sx={{
									position: "fixed", 
									top: 0, 
									right: 0,
								}}
								onClick={this.handleCloseModal}
							>
								<CloseIcon />
							</IconButton>
						</Stack>
						<TextField
							required
							fullWidth
							autoFocus
							name='email'
							id='email'
							label='Email Address'
							autoComplete='email'
							sx={{
								mt: 2,
							}}
						/>
						<Button
							type='submit'
							fullWidth
							variant='contained'
							sx={{ mt: 3, mb: 2 }}>
							Send Email
						</Button>
					</Box>
				</Modal>
			</Container>
		);
	}
}

export default function (props) {
	const navigate = useNavigate();
	return <SignIn {...props} navigate={navigate} />;
}
